    "Highly Effective Thermal Regenerator for Low Temperature Cryocoolers Project",nt"tracking_summary":
    {ntt"total": 4,ntt"recent": 2nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T21:49:59.107821",nt"name": "highly-effective-thermal-regenerator-for-low-temperature-cryocoolers-project",nt"isopen":
    true,nt"url": null,nt"notes": "Future missions to investigate the structure
    and evolution of the universe require highly efficient, low-temperature cryocoolers
    for low-noise detector systems. We propose to develop a highly efficient low-cost
    regenerator for regenerative cryocoolers with cooling temperatures in the range
    of 15 K and below. The proposed regenerator uses an innovative non-rare-earth material
    to achieve a volumetric specific heat of about 0.65  to 0.31 J/cm3-K at temperatures
    of 15 to 4.2 K.  The large heat capacity will substantially reduce the thermal swing
    during periodic heat transfer and therefore improve the efficiency of low-temperature
    regenerative cryocoolers. The regenerator will be lightweight and easy to fabricate.
    In Phase I we will optimize the regenerator for a specific cooling application.
     We will use the resulting design and model to show that a regenerative cryocooler
    can achieve a very high efficiency. In Phase II we will build a prototype regenerator,
    measure its key performance parameters, and integrate it with an existing cryocooler
    to demonstrate its high thermal effectiveness.",nt"license_title": "U.S. Government
